<?php
	include "func.php";
	
	global $g_OCR_apiurl, $g_OCR_get_token_param, $g_OCR_get_info_param, $g_OCR_get_head_graph_param;
	global $g_OCR_front_type_code, $g_OCR_back_type_code;
	
	// initial
	$status_code_succeed 	= "D6"; // 成功狀態代碼
	$status_code_failure 	= "D5"; // 失敗狀態代碼
	$data 					= array();
	$fields2   				= array();
	$userList  				= array();
	$numbering 				= "";
	$link					= null;
	$Insurance_no 			= ""; // *
	$Remote_insurance_no 	= ""; // *
	$Person_id 				= ""; // *
	$Mobile_no 				= "";
	$json_Person_id 		= "";
	$Sales_id 				= "";
	$status_code 			= "";
	$Member_name			= "";
	$Role 					= "";
	$order_status			= "";
	$Base64_image			= "";
	$Id_Type				= "";
	$api_ret_json			= "";
	$apiret_code			= true;
	
	// Api ------------------------------------------------------------------------------------------------------------------------
	api_get_post_param($token, $Insurance_no, $Remote_insurance_no, $Person_id);
	$Base64_image	= isset($_POST['Image'])	? $_POST['Image']	: '';
	$Id_Type		= isset($_POST['Type'])		? $_POST['Type']	: '';
	
	// 模擬資料
	if ($g_test_mode)
	{
		$Insurance_no 		 = "Ins1996";
		$Remote_insurance_no = "appl2022";
		$Person_id 			 = "A123456789";
		$Base64_image_front  = "data:image/jpeg;base64,";
		$Base64_image_back   = "data:image/jpeg;base64,";
		
		$Id_Type = $g_OCR_front_type_code;
		switch ($Id_Type)
		{
			case $g_OCR_back_type_code :
				$Base64_image = $Base64_image_back;
				break;
			case $g_OCR_front_type_code:
				$Base64_image = $Base64_image_front;
				break;
		}
	}
	
	// 當資料不齊全時，從資料庫取得
	$ret_code = get_salesid_personinfo_if_not_exists($link, $Insurance_no, $Remote_insurance_no, $Person_id, $Role, $Sales_id, $Mobile_no, $Member_name);
	if (!$ret_code)
	{
		$data = result_message("false", "0x0206", "map person data failure", "");
		JTG_wh_log($Insurance_no, $Remote_insurance_no, get_error_symbol($data["code"])." query result :".$data["code"]." ".$data["responseMessage"]."\r\n".$g_exit_symbol."OCR exit ->"."\r\n", $Person_id);
		
		header('Content-Type: application/json');
		echo (json_encode($data, JSON_UNESCAPED_UNICODE));
		return;
	}
	
	JTG_wh_log($Insurance_no, $Remote_insurance_no, "OCR entry <-", $Person_id);
	
	// 驗證 security token
	$ret = protect_api("JTG_Parse_OCR", "OCR exit ->"."\r\n", $token, $Insurance_no, $Remote_insurance_no, $Person_id);
	if ($ret["status"] == "false")
	{
		header('Content-Type: application/json');
		echo (json_encode($ret, JSON_UNESCAPED_UNICODE));
		return;
	}
	
	// start
	if ($Insurance_no 			!= '' &&
		$Remote_insurance_no 	!= '' &&
		$Person_id 				!= '' &&
		$Base64_image 			!= '' &&
		$Id_Type 				!= '' )
	{
		try
		{
			// add code at here
			$link = mysqli_connect($host, $user, $passwd, $database);
			$data = result_connect_error ($link);
			if ($data["status"] == "false")
			{
				JTG_wh_log($Insurance_no, $Remote_insurance_no, get_error_symbol($data["code"])." query result :".$data["code"]." ".$data["responseMessage"]."\r\n".$g_exit_symbol."OCR exit ->"."\r\n", $Person_id);
				header('Content-Type: application/json');
				echo (json_encode($data, JSON_UNESCAPED_UNICODE));
				return;
			}
			mysqli_query($link,"SET NAMES 'utf8'");
			
			// get token
			JTG_wh_log($Insurance_no, $Remote_insurance_no, "call api - get token", $Person_id);
			$api_ret_json = CallAPI_viaFormData("POST", $g_OCR_apiurl."requestToken.php", $g_OCR_get_token_param, null, false);
			JTG_wh_log($Insurance_no, $Remote_insurance_no, "result api - get token", $Person_id);
			
			$object_token = json_decode($api_ret_json);
			$data = ocr_result_check_token($object_token, $Insurance_no, $Remote_insurance_no, $Person_id, $api_ret_json, $apiret_code);
			
			// parse identity
			if ($apiret_code)
			{
				$API_command = $g_OCR_apiurl."uploadAndWait_base64.php";
				$input_data = sprintf($g_OCR_get_info_param, $object_token->token, $Base64_image, $Id_Type);
				
				JTG_wh_log($Insurance_no, $Remote_insurance_no, "call api - parse identity", $Person_id);
				$api_ret_json = CallAPI_viaFormData("POST", $API_command, $input_data, null, false);
				JTG_wh_log($Insurance_no, $Remote_insurance_no, "result api - parse identity", $Person_id);
				
				//$data = parse_OCR($out);
				$log_str = "";
				$data = ocr_result_parse_identity($Insurance_no, $Remote_insurance_no, $Person_id, $api_ret_json, $Id_Type, $apiret_code);
			}
			
			// get head
			if ($apiret_code && $Id_Type == $g_OCR_front_type_code)
			{
				$API_command = $g_OCR_apiurl."requestHeadImage.php";
				$OCR_get_head_graph_param = $g_OCR_get_head_graph_param;
				$OCR_get_head_graph_param["token"] = $object_token->token;
				$OCR_get_head_graph_param["file"]  = $Base64_image;
				
				JTG_wh_log($Insurance_no, $Remote_insurance_no, "call api - get head", $Person_id);
				$api_ret_json = CallAPI_viaFormData("POST", $API_command, $input_data, null, false);
				JTG_wh_log($Insurance_no, $Remote_insurance_no, "result api - get head", $Person_id);
				
				$data = ocr_result_get_headimage($Insurance_no, $Remote_insurance_no, $Person_id, $api_ret_json, $apiret_code);
			}
			if ($apiret_code)
			{
				$status_code = $status_code_succeed;
				$data = result_message("true", "0x0200", "Succeed!", $api_ret_json);
			}
			else
			{
				$status_code = $status_code_failure;
			}
		}
		catch (Exception $e)
		{
			$data = result_message("false", "0x0209", "Exception error!", "");
			JTG_wh_log_Exception($Insurance_no, $Remote_insurance_no, get_error_symbol($data["code"]).$data["code"]." ".$data["responseMessage"]." error :".$e->getMessage(), $Person_id);
		}
		finally
		{
			JTG_wh_log($Insurance_no, $Remote_insurance_no, "finally procedure", $Person_id);
			try
			{
				if ($status_code != "")
				{
					$data_status = modify_order_state($link, $Insurance_no, $Remote_insurance_no, $Person_id, $Role, $Sales_id, $Mobile_no, $status_code, false);
					if (count($data_status) > 0 && $data_status["status"] == "false")
						$data = $data_status;
				}
				$get_data = get_order_state($link, $order_status, $Insurance_no, $Remote_insurance_no, $Person_id, $Role, $Sales_id, $Mobile_no, false);
				
				if ($link != null)
				{
					mysqli_close($link);
					$link = null;
				}
			}
			catch (Exception $e)
			{
				$data = result_message("false", "0x0207", "Exception error: disconnect!", "");
				JTG_wh_log_Exception($Insurance_no, $Remote_insurance_no, get_error_symbol($data["code"]).$data["code"]." ".$data["responseMessage"]." error :".$e->getMessage(), $Person_id);
			}
			JTG_wh_log($Insurance_no, $Remote_insurance_no, "finally complete - status:".$status_code, $Person_id);
		}
	}
	else
	{
		$data = result_message("false", "0x0202", "API parameter is required!", "");
		$get_data = get_order_state($link, $order_status, $Insurance_no, $Remote_insurance_no, $Person_id, $Role, $Sales_id, $Mobile_no, true);
	}
	JTG_wh_log($Insurance_no, $Remote_insurance_no, get_error_symbol($data["code"])." query result :".$data["code"]." ".$data["responseMessage"]."\r\n".$g_exit_symbol."OCR exit ->"."\r\n", $Person_id);
	$data["orderStatus"] = $order_status;
	
	header('Content-Type: application/json');
	echo (json_encode($data, JSON_UNESCAPED_UNICODE));
?>